import React from 'react';
import ReactDOM from 'react-dom';
import add from './Calculator';

ReactDOM.render(
  <>
    <ul>
      <li> The sum of two no is {add(40, 4)}</li>
    </ul>
  </>,
  document.getElementById('root')
);
